(1, 'If you need a larger number of paragraphs, the Arabic text generator allows you to increase the number of paragraphs as you want, the text will not appear divided and does not contain language errors, the Arabic text generator is useful for web designers in particular, where the customer often needs to see a real picture for site design.', 'en', 1, '2022-05-04 07:05:27', '2022-05-04 07:05:27'),
(2, 'Wenn Sie eine größere Anzahl von Absätzen benötigen, können Sie mit dem arabischen Textgenerator die Anzahl der Absätze beliebig erhöhen, der Text erscheint nicht geteilt und enthält keine Sprachfehler, der arabische Textgenerator ist insbesondere für Webdesigner nützlich, wo der Kunde oft ein echtes Bild für das Site-Design sehen muss.', 'gr', 1, '2022-05-04 07:05:27', '2022-05-04 07:05:27');
